import Header from './components/Header/Header'
import './App.css'
import {connect} from "react-redux";

const App = (props) => {


    return (
        <div className={"App"}>
            {
                props.appState.map((track) =>
                    <button> {track.text} </button>
                )
            }
        </div>

    )
}

export default connect(
    state => ({
        appState: state
    }),
    dispatch => ({
        onAddTodo: ( (todoName) => {
            dispatch({id: 2, text: todoName})
        })
    })
)(App)
